const ExpenseFilter = () => {

    const year = new Date().getFullYear();
    const years = Array.from(new Array(20),( val, index) => year - index);
    console.log("Year is: " + year + years);
   
   return (<form>
        <select name='year' id='year'>
            {
                console.log(years + "423423423")
            };
        </select>
    </form>
    )
};

export default ExpenseFilter;
